import "./../styles/Order.scss";

const Order = () => {
  return (
    <div className="order-page">
      <div className="container">
        <h4>Оформление заказа</h4>
        <div className="row">
          <div className="col">
            <div>
              <h3>Доставка курьером</h3>
              <span> 499 com</span>
            </div>
          </div>
          <div className="col"></div>
        </div>
      </div>
    </div>
  );
};

export default Order;
